export default function cleanSet(mySet, startString) {
  // Use Array.from to convert the set to an array and filter based on the startString
  const result = Array.from(mySet)
    .filter((value) => value.startsWith(startString))
    .map((value) => value.slice(startString.length));

  // Join the filtered values with a '-' separator and return
  return result.join('-');
}

